import React from 'react'
import { StyleSheet, View, Text} from 'react-native'
import { getArticles } from '@src/reduxStore/actions/get_articles'
import { connect } from 'react-redux'


class Account extends React.Component {

    componentDidMount() {
        this.props.getArticles()
        fetch('https://jsonplaceholder.typicode.com/posts')
        .then((response) => console.log(response), response.json())
        .then((result) => {
            console.log(result)
            dispatch({
                type: GET_ARTICLES,
                payload: result
            })
        })
        .catch((err) => console.error(err.message))
    }

    render() {
        return (
            <View>
                <Text>Account</Text>
                {this.props.articles.map(art =>
                    <View key={art.id}>
                        <Text>Works:{art.title}</Text>
                    </View>
                )}
            </View>
        )
    }

}
const styles = StyleSheet.create({
        
})

const mapStateToProps = (state) => { console.log('?????',state) 
    return { articles: state.article.articles }
}

const mapDispatchToProps = dispatch => ({ setArticle: () => dispatch(getArticles()) })


export default connect(mapStateToProps, mapDispatchToProps)(Account)
